Redakai: Conquer the Kairu - Season 2 - Episodes 1 to 13 (SD - WEB-DL)
----------------------------------------------------------------------

The Redakai of Earth have assigned their most promising warriors to find
and collect Kairu energy. Ky, a 15-year-old student of ancient martial arts,
embarks on an epic quest aided by his friends Maya and Boomer. Their greatest
challenge remains the villainous Lokar, who has assembled his own teams of
warriors know as E-Teens to find the Kairu before the Redakai. With the
fate of the universe at stake, good and evil are put to the ultimate test.

Produced by Spin Master Studios.

